import React from 'react';
import './style.css';
import 'bootstrap/dist/css/bootstrap.min.css';


function Header() {
  return (
    <div className="App">
       <div class="container mt-4 ml-4">
          <div class="row">
             <div class="header">
                <ul>
                   <li>Home</li>
                   <li>Product</li>  
                   <li>Home</li>  
                   <li>Home</li>    
                </ul>  
             </div> 
          </div>
       </div>
    </div>
  );
}

export default Header;
